def solve(list1, list2):
    count = 0
    map1 = map(list1.count, list1)
    map2 = map(list2.count, list2)
    for i,j in zip(map1, map2):
        if i == j:
            count += 1
    return count

def solve(list1, list2):
    count = 0
    pairs = list(zip(list1, list2))
    pairs_map = map(lambda x: (x[0], x[1]), pairs)
    for pair in pairs_map:
        if pair[0] == pair[1]:
            count += 1
    return count
